import './ExpenseTracker.css';

function ExpenseTracker(props) {
    return (
        <div className="expense-item">
            <div>Date</div>
            <div className="expense-item__description">
                <h2>{props.title}</h2>
                <div className="expense-item__price">Amount</div>
            </div>

        </div>
    )
}

export default ExpenseTracker;
